import React from "react";
import TopBanner from "../../components/TopBanner";
import MuiThemeProvider from '@material-ui/core/styles/MuiThemeProvider';
import { TextField } from "@material-ui/core";
import { Button } from "@material-ui/core";
import './ReachOut.css';

const ReachOut = () => {
    const [value, setValue] = React.useState('Controlled');
    const handleChange = (event) => {
        setValue(event.target.value);
    };
    return (
        <>
            <TopBanner />
            <p className = "finalComponent">Hello, thanks a lot for taking the time out to read my blog and for trying to reach out to me! I'm very grateful for that :)</p>
            <MuiThemeProvider>
                <div style = {{margin: "50px auto", maxWidth: "500px"}}>
                    <TextField label = "FirstName" placeholder = "Please enter your first name." fullWidth = "true" variant="outlined"/>
                    <br />
                    <br />
                    <TextField label = "LastName" placeholder = "Please enter your last name." fullWidth = "true" variant="outlined"/>
                    <br />
                    <br />
                    <TextField label = "Email" placeholder = "Please enter your email ID." fullWidth = "true" variant="outlined"/>
                    <br />
                    <br />
                    <TextField
                        id="outlined-multiline-flexible"
                        label="Message"
                        placeholder = "I'd love to hear from you!"
                        fullWidth = "true"
                        multiline
                        maxRows={4}
                        value={value}
                        onChange={handleChange}
                        variant="outlined"
                    />
                    <br />
                    <br />
                    <Button color = "primary" variant = "contained">Submit</Button>
                </div>
            </MuiThemeProvider>
        </>
    )
};

export default ReachOut;
